BlackBox.templateD:
-- register begin
~GENSYM[~COMPNAME_register][0] : process(~ARG[1],~ARG[2]~VARS[3])
begin
  if ~ARG[1] = '0' then
    ~RESULT <= ~ARG[3];
  elsif rising_edge(~ARG[2]) then
    ~RESULT <= ~ARG[4];
  end if;
end process;
-- register end

-- regEn begin
~GENSYM[~COMPNAME_regEn][0] : process(~CLK[0],~RST[0]~VARS[1]~VARS[2])
begin
  if ~RST[0] = '0' then
    ~RESULT <= ~ARG[1];
  elsif rising_edge(~CLK[0]) then
    if ~ARG[2] then
      ~RESULT <= ~ARG[3];
    end if;
  end if;
end process;
-- regEn end
